import React, {useState, useEffect} from 'react';
import { View, Text, Button, TouchableOpacity, StyleSheet, Image, FlatList } from 'react-native'
import { images, COLORS, FONTS, SIZES } from '../../constants';


const View1 = (props) => {
  const [items, setItems] = React.useState([])

  function APIItems() {
    fetch(props.apiURI + '/items', {
      method: 'GET'
    })
      .then(response => {
        if (response.ok == false) {
          throw new Error("HTTP Code " + response.status + " - " + JSON.stringify(response.json()));
        }
        return response.json();
      })
      .then(json => {
        setItems(json)
        console.log(json, 'come loged');
      })
      .catch(error => {
        console.log("Error message:")
        console.log(error.message)
      });
  }

  useEffect(() => {
    APIItems();
  }, []);

  function renderItem(item, index) {
    return (
      <TouchableOpacity
        style={{ flex: 1, flexDirection: 'row' }}
      >
        <View style={{ flex: 1, alignItems: "center", justifyContent: "center" }}>
          <Image
            source={item.images}
            resizeMode="contain"
            style={{
              width: 130,
              height: 100,
            }}
          />
        </View>
        <View style={{ flex: 1.5, marginLeft: SIZES.radius, justifyContent: "center" }}>
          <Text style={{ color: COLORS.black, ...FONTS.body3 }}>{item.title}</Text>
          <Text style={{ color: COLORS.lightGray, ...FONTS.body5 }}>{item.description}</Text>
          <Text style={{ ...FONTS.h3 }}>{item.price}$</Text>
        </View>
      </TouchableOpacity>
    )
  }

  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center', marginTop: -100 }}>
      <Text style={{ fontSize: 50, fontWeight: '700' }}>Cpanel</Text>
      <Text>You have successfully logged in</Text>
      <Button
        title="POST A NEW ITEM"
        onPress={() => props.navigation.navigate('Todos')}
      />
      <Button
        title="Logout"
        onPress={props.onLogout}
      />

      {/* <View style={{ flex: 1, paddingBottom: SIZES.padding }}>
                    <FlatList
                        showsVerticalScrollIndicator={false}
                        data={items}
                        keyExtractor={item => item.id.toString()}
                        renderItem={({ item, index }) => renderItem(item, index)}
                    />
      </View> */}
    </View>

  )
}



export default View1
